    const data = [
      { name: 'Olha S.', salary: 3200 },
      { name: 'Alex S.', salary: 3200 },
      { name: 'Olha S.', salary: 3200 },
    ];
    return (
      <div className='app'>
        <AppInfo />
        <div className='search-panel'>
          <SearchPanel />
          <AppFilter />
        </div>
            <EmployeesList />
            <EmployeesAddForm />
      </div>
    );
}

export default App
